// Process all items that are coming in
const items = [];

// Loop through each input item
for (const item of $input.all()) {
  // Clone the item to avoid reference issues
  const newItem = {...item.json};

  // Make sure binary data exists
  if (item.binary && item.binary.data) {
    // Create new binary objects to avoid reference issues
    newItem.binary = newItem.binary || {};
    newItem.binary.data = {...item.binary.data};

    // Ensure consistent naming with .mp4 extension
    const index = items.length + 1;
    const fileName = `video_${index}.mp4`;

    console.log(`Processing item ${index}`);
    console.log(`Original filename: ${item.binary.data.fileName}`);

    // Set the filename and MIME type
    newItem.binary.data.fileName = fileName;
    newItem.binary.data.mimeType = 'audio/mp4';  // Try audio/mp4 instead of video/mp4

    console.log(`New filename: ${fileName}`);
    console.log(`New MIME type: audio/mp4`);
  }

  // Add to our items array
  items.push({json: newItem, binary: newItem.binary});
}

// Return all processed items
return items;

